public boolean validateWrite()
{
    boolean ret;
    SKS_EB_FileStorage  sks_EB_FileStorage;

    //BankFabric
    select firstonly sks_EB_FileStorage;

    if (sks_EB_FileStorage.StorageOption_APEFTFXDD == SKS_EB_BankIntegOptWithNoLicense::BankFabricEnumValue)
    {
        if(!SKS_EFT_Setup_BTBBankFabricFileLocation.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_BTBBankFabricFileLocation.setFocus();

            return false;
        }
    }
    else
    {
        if(!SKS_EFT_Setup_BBFileName.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_BBFileName.setFocus();

            return false;
        }

        if(!SKS_EFT_Setup_BBFilePath.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_BBFilePath.setFocus();

            return false;
        }

        if(SKS_EFT_Setup_BBArchive.value() && !SKS_EFT_Setup_BBPathArchive.valueStr())
        {
            Box::warning("@SKS253","@SKS225"); //required field

            SKS_EFT_Setup_BBPathArchive.setFocus();

            return false;
        }
    }

    if(SKS_EFT_Setup.BTBCommID == '')
    {
        warning("@SKS253","@SKS225"); //required field

        SKS_EFT_Setup_BBCommID.setFocus();

        return false;
    }

    ret = super();

    return ret;
    }

