public boolean validate()
{
    boolean ret;
    int thisval;
    System.Text.StringBuilder sb = new System.Text.StringBuilder();

    ;

    thisval = str2int(SKS_EFT_Setup_BBPeriodsRet.valueStr());

    if(thisval < 2 )
    {
        sb.Append("@SKS239");
        sb.Replace('%1','2');
        Box::stop(sb.ToString(),"@SKS225"); //must be greater than 2

        SKS_EFT_Setup_BBPeriodsRet.setFocus();

        return false;
    }

    ret = super();


    return ret;
}

public void modified()
{
    super();

    if(SKS_EFT_Setup.BTBPurgeFiles == NoYes::Yes)
    {
        SKS_EFT_Setup_BBPeriodsRet.enabled(true);
    }
    else
    {
        SKS_EFT_Setup_BBPeriodsRet.enabled(false);
    }
}

protected void initialize()
{
    SKS_EB_FileStorage  sks_EB_FileStorage;

    //BankFabric
    select firstonly sks_EB_FileStorage;
    if (sks_EB_FileStorage.StorageOption_APEFTFXDD == SKS_EB_BankIntegOptWithNoLicense::BankFabricEnumValue)
    {
        FileName.visible(false);
        SKS_EFT_Setup_BBFilePath.visible(false);
        SKS_EFT_Setup_BBPathArchive.visible(false);
    }
    else
    {
        SKS_EFT_Setup_BTBBankFabricFileLocation.visible(false);
    }
    super();
}

void clicked()
{
    Args args = new Args();
    FormRun formrun;
    ;

    args.parmObject( formrun);
    args.caller(element);
    formrun = new MenuFunction( menuitemdisplaystr( SKS_EB_COMMUNICATIONS ), MenuItemType::Display).create(args);
    formrun.run();
}

public void lookup()
{
    SKS_BF_TmpLookupTable TmpLookupTable;

    Query query = new Query();

    QueryBuildDataSource qbds;

    QueryBuildRange queryBuildRange;

    SysTableLookup sysTableLookup;

    TmpLookupTable = SKS_BF_TmpLookupTable::construct(SKS_BF_FileLocCategory::BTB);

    sysTableLookup = SysTableLookup::newParameters(tablenum(SKS_BF_TmpLookupTable),this);

    sysTableLookup.addLookupfield(fieldnum(SKS_BF_TmpLookupTable,Name));
    sysTableLookup.addLookupfield(fieldnum(SKS_BF_TmpLookupTable,Description));

    qbds = query.addDataSource(tableNum(SKS_BF_TmpLookupTable));

    queryBuildRange = qbds.addRange(fieldnum(SKS_BF_TmpLookupTable,Name));

    sysTableLookup.parmTmpBuffer(TmpLookupTable);

    sysTableLookup.performFormLookup();
    //super();
}

void archivecheckbox_chk()
{
    //if archive checkbox is clicked enable archive path, otherwise disable the path
    if( SKS_EFT_Setup_BBArchive.value())
    {
        SKS_EFT_Setup_BBPathArchive.enabled(true);
    }
    else
    {
        SKS_EFT_Setup_BBPathArchive.enabled(false);
    }
}
